// src/components/Navbar.jsx
import React from 'react';

const Navbar = () => {
  return (
    <nav className="flex justify-between items-center py-4 px-8 bg-gradient-to-r from-teal-700 to-green-900 shadow-lg">
      <div className="text-white text-xl font-bold">ZAKER</div>
      <div className="space-x-4">
        <button className="text-white">Home</button>
        <button className="text-white">Login</button>
        <button className="text-white">Create Account</button>
        <select className="bg-white text-teal-600 px-2 py-1 rounded">
          <option>العربية</option>
          <option>English</option>
        </select>
      </div>
    </nav>
  );
};


export default Navbar;
